define(["templates/competitions"],function(e){return Vue.extend({template:e["new-phase"],data:function(){return{name:""}},methods:{handleKeyDown:function(e){13===e.keyCode&&this.confirm()},confirm:function(){0<this.name.length&&this.$emit("close",this.name)},cancel:function(){this.$emit("close")}},mounted:function(){window.setTimeout(function(){$("#txtNewPhaseName").focus()},500)}})});